-- SQLite
-- Note: I apologize for having such a huge file. There are a lot of INSERT commands (as I had to make sure every question had a output) and the insertion process may take 5-7 mins

CREATE TABLE "User" (
	"userID"	INTEGER NOT NULL,
	"userName"	TEXT NOT NULL,
	"userAge"	INTEGER NOT NULL,
	"userEmail"	TEXT NOT NULL,
	"userAddress"	TEXT NOT NULL,
	PRIMARY KEY("userID")
);


CREATE TABLE "Channel" (
	"ChannelID"	INTEGER,
	"ChannelName"	TEXT,
	"ownerID"	INTEGER,
	"subscriptionCount"	INTEGER,
	"creationDateTime"	TEXT,
	FOREIGN KEY("ownerID") REFERENCES "User"("userID"),
	PRIMARY KEY("ChannelID")
);


CREATE TABLE "Video" (
	"channelID"	INTEGER,
	"videoURL"	TEXT UNIQUE,
	"title"	TEXT,
	"thumbnail"	TEXT,
	"category"	TEXT,
	"description"	TEXT,
	"duration"	TEXT,
	"uploadTime"	TEXT,
	FOREIGN KEY("channelID") REFERENCES "Channel"("ChannelID"),
	PRIMARY KEY("videoURL","channelID")
);



CREATE TABLE "SponsorList" (
	"sponsorID"	INTEGER UNIQUE,
	"sponsorName"	TEXT,
	"sponsorPhone"	TEXT,
	"sponsorAddress"	TEXT,
	PRIMARY KEY("sponsorID")
);


CREATE TABLE "Subscription" (
	"subscriptionID"	INTEGER,
	"channelID"	INTEGER,
	"subscriberID"	INTEGER,
	"subscriptionType"	TEXT,
	FOREIGN KEY("channelID") REFERENCES "Channel"("ChannelID"),
	FOREIGN KEY("subscriberID") REFERENCES "User"("userID"),
	PRIMARY KEY("subscriptionID","channelID","subscriberID")
);



CREATE TABLE "Comment" (
	"videoURL"	TEXT,
	"commentID"	INTEGER,
	"commenterID"	INTEGER,
	"commentText"	TEXT,
	"likes"	INTEGER,
	"sentiment"	INTEGER,
	FOREIGN KEY("videoURL") REFERENCES "Video"("videoURL"),
	FOREIGN KEY("commenterID") REFERENCES "User"("userID"),
	PRIMARY KEY("videoURL","commentID")
);


CREATE TABLE "Statistics" (
	"videoURL"	TEXT,
	"likes"	INTEGER,
	"dislikes"	INTEGER,
	"viewCount"	INTEGER,
	"shares"	INTEGER,
	"comments"	INTEGER,
	FOREIGN KEY("videoURL") REFERENCES "Video"("videoURL"),
	PRIMARY KEY("videoURL")
);



CREATE TABLE "InfoVideo" (
	"videoURL"	TEXT,
	"keywords"	TEXT,
	PRIMARY KEY("videoURL","keywords"),
	FOREIGN KEY("videoURL") REFERENCES "Video"("videoURL")
);


CREATE TABLE "SponsoringVideo" (
	"sponsorID"	INTEGER,
	"videoURL"	TEXT,
	"sponsorAmount"	INTEGER,
	PRIMARY KEY("sponsorID","videoURL"),
	FOREIGN KEY("videoURL") REFERENCES "Video"("videoURL"),
	FOREIGN KEY("sponsorID") REFERENCES "SponsorList"("sponsorID")
);


CREATE TABLE "Views" (
	"viewerID"	INTEGER,
	"videoURL"	TEXT,
	FOREIGN KEY("videoURL") REFERENCES "Video"("videoURL"),
	FOREIGN KEY("viewerID") REFERENCES "User"("userID"),
	PRIMARY KEY("viewerID","videoURL")
);

